import background from "./images/bg-main-desktop.png";
import CartFront from "./CartFront/CartFront";
import CartBack from "./CartBack/CartBack";
import CartForm from "./CartForm/Cartform";
import { useState } from "react";

function App() {
  const [number, setNumber] = useState("");
  const [name, setName] = useState("");
  const [dateMM, setDateMM] = useState("MM");
  const [cvc, setCvc] = useState("");

  return (
    <div className="App">
      <img className="desktop-background-image" src={background} alt="img" />
      <div className="carts-container">
        <CartFront number={number} name={name} dateMM={dateMM} />
        <CartBack cvc={cvc} />
      </div>
      <CartForm
        setNumber={setNumber}
        number={number}
        setName={setName}
        setDateMM={setDateMM}
        setCvc={setCvc}
        dateMM={dateMM}
      />
    </div>
  );
}

export default App;
